import React from 'react';
import ProblemBox from './ProblemBox.js';
export default function Column(props){

    return(
        <div>
            <div>
                <h1>{prop.genre}</h1>
            </div>
            <ProblemBox point={"100"} />
            <ProblemBox point={"200"}/>
            <ProblemBox point={"300"}/>
            <ProblemBox point={"400"}/>
            <ProblemBox point={"500"}/>
        </div>
    )
}
